  "translationLines": [
    {
      "lineNumber": 197802,
      "originalJapaneseLine": "「う〜〜〜ん……」",
      "translatedEnglishLine": "\"Uhhh...\""
    },
    {
      "lineNumber": 197803,
      "originalJapaneseLine": "まるで踊りでも舞うように、",
      "translatedEnglishLine": "As if dancing in a performance,"
    },
    {
      "lineNumber": 197804,
      "originalJapaneseLine": "レイが左右へ動く。",
      "translatedEnglishLine": "Rei moved left and right."
    },
    {
      "lineNumber": 197805,
      "originalJapaneseLine": "「最近……",
      "translatedEnglishLine": "\"Recently..."
    },
    {
      "lineNumber": 197806,
      "originalJapaneseLine": "　ごくごく最近見た顔な気がするんだが……」",
      "translatedEnglishLine": " I feel like I've seen that face very, very recently...\""
    },
    {
      "lineNumber": 197807,
      "originalJapaneseLine": "「てやーーーーっ！」",
      "translatedEnglishLine": "\"Take thattttt!\""
    },
    {
      "lineNumber": 197808,
      "originalJapaneseLine": "「おっと」",
      "translatedEnglishLine": "\"Oops.\""
    },
    {
      "lineNumber": 197809,
      "originalJapaneseLine": "飛び跳ねたレリコフの連続攻撃を、",
      "translatedEnglishLine": "Reiko’s continuous jump attacks,"
    },
    {
      "lineNumber": 197810,
      "originalJapaneseLine": "するりと木の葉のように避ける魔人レイ。",
      "translatedEnglishLine": "were slipped past like leaves in the wind by the demon Rei."
    },
    {
      "lineNumber": 197811,
      "originalJapaneseLine": "「はわっ！？」",
      "translatedEnglishLine": "\"Hah!?\""
    },
    {
      "lineNumber": 197812,
      "originalJapaneseLine": "「せっ！」",
      "translatedEnglishLine": "\"Seh!\""
    },
    {
      "lineNumber": 197813,
      "originalJapaneseLine": "「あいたーっ！？」",
      "translatedEnglishLine": "\"Ouchh!?\""
    },
    {
      "lineNumber": 197814,
      "originalJapaneseLine": "宙に浮いたレリコフに容赦なく、",
      "translatedEnglishLine": "Without mercy on the airborne Reiko,"
    },
    {
      "lineNumber": 197815,
      "originalJapaneseLine": "爪先蹴りが突き刺さった。",
      "translatedEnglishLine": "a toe kick struck deep."
    },
    {
      "lineNumber": 197816,
      "originalJapaneseLine": "「あーっ、いちちち……",
      "translatedEnglishLine": "\"Aah, that hurts...\""
    },
    {
      "lineNumber": 197817,
      "originalJapaneseLine": "　ガードしたのに骨折られたかと思った」",
      "translatedEnglishLine": " Even though I guarded it, I thought I might have broken a bone.\""
    },
    {
      "lineNumber": 197818,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 197819,
      "originalJapaneseLine": "「ああ、くそッ、駄目だ！",
      "translatedEnglishLine": "\"Ah, damn it, no good!"
    },
    {
      "lineNumber": 197820,
      "originalJapaneseLine": "　イライラしやがる！」",
      "translatedEnglishLine": "This is frustrating!\""
    },
    {
      "lineNumber": 197821,
      "originalJapaneseLine": "レイは頭をガリガリとかきむしった。",
      "translatedEnglishLine": "Rei scratched at his head irritably."
    },
    {
      "lineNumber": 197822,
      "originalJapaneseLine": "「あの＜エール＞ってガキ見覚えあんのに……",
      "translatedEnglishLine": "\"I do recognize that kid ‘Aile’..."
    },
    {
      "lineNumber": 197823,
      "originalJapaneseLine": "　……どこで見たかちっとも思い出せねぇ」",
      "translatedEnglishLine": " ...but I just can't remember where I saw him.\""
    },
    {
      "lineNumber": 197824,
      "originalJapaneseLine": "「はぁー、これが老化か……？",
      "translatedEnglishLine": "\"Hah, is this aging...?"
    },
    {
      "lineNumber": 197825,
      "originalJapaneseLine": "　物忘れがひどくっていけねぇ」",
      "translatedEnglishLine": "My forgetfulness is terrible.\""
    },
    {
      "lineNumber": 197826,
      "originalJapaneseLine": "「てっ……」",
      "translatedEnglishLine": "\"Tch...\""
    },
    {
      "lineNumber": 197827,
      "originalJapaneseLine": "「テメェ！　やる気あんのか！？",
      "translatedEnglishLine": "\"You! Do you have any fighting spirit!?"
    },
    {
      "lineNumber": 197828,
      "originalJapaneseLine": "　さっきからのらりくらりと！」",
      "translatedEnglishLine": "You've been dodging around since earlier!\""
    },
    {
      "lineNumber": 197829,
      "originalJapaneseLine": "既に魔人レイとの戦闘は三十分にも及んでいる。",
      "translatedEnglishLine": "The fight with the demon Rei had already lasted for thirty minutes."
    },
    {
      "lineNumber": 197830,
      "originalJapaneseLine": "理由はひとえに、レイがすぐ逃げることにあった。",
      "translatedEnglishLine": "The reason was simply that Rei would immediately flee."
    },
    {
      "lineNumber": 197831,
      "originalJapaneseLine": "果敢に攻め込んでも逃げられる為に決定打に欠け、",
      "translatedEnglishLine": "Even when daringly attacking, decisive blows were lacking because Rei escaped."
    },
    {
      "lineNumber": 197832,
      "originalJapaneseLine": "一向に勝負が決まらない状況が続いていた。",
      "translatedEnglishLine": "The situation continued with no end to the contest."
    },
    {
      "lineNumber": 197833,
      "originalJapaneseLine": "「ふんっ、そうがなり立てるな」",
      "translatedEnglishLine": "\"Hmph, don't get so worked up.\""
    },
    {
      "lineNumber": 197834,
      "originalJapaneseLine": "「戦う気ならハナからねぇよ」",
      "translatedEnglishLine": "\"I never intended to fight from the start.\""
    },
    {
      "lineNumber": 197835,
      "originalJapaneseLine": "「アア！？」",
      "translatedEnglishLine": "\"Huh?!\""
    },
    {
      "lineNumber": 197836,
      "originalJapaneseLine": "「俺も難しい立場にいてな……",
      "translatedEnglishLine": "\"I'm also in a difficult position..."
    },
    {
      "lineNumber": 197837,
      "originalJapaneseLine": "　仕事はしてるってポーズくらい取らねェと、",
      "translatedEnglishLine": "If I don't at least pretend to be doing my job,"
    },
    {
      "lineNumber": 197838,
      "originalJapaneseLine": "　サテラがうるさいんだ」",
      "translatedEnglishLine": "Satera keeps nagging me.\""
    },
    {
      "lineNumber": 197839,
      "originalJapaneseLine": "魔人レイは手持ちの櫛を",
      "translatedEnglishLine": "The demon Rei fiddled with the comb in his hand"
    },
    {
      "lineNumber": 197840,
      "originalJapaneseLine": "指の中で弄びながら肩をすくめた。",
      "translatedEnglishLine": "between his fingers and shrugged his shoulders."
    },
    {
      "lineNumber": 197841,
      "originalJapaneseLine": "「元ケイブリス派の魔人や魔物は",
      "translatedEnglishLine": "\"Former Cambrys faction demons and monsters"
    },
    {
      "lineNumber": 197842,
      "originalJapaneseLine": "　肩身が狭くて参るな」",
      "translatedEnglishLine": "have a hard time and feel out of place."
    },
    {
      "lineNumber": 197843,
      "originalJapaneseLine": "「――と言って、魔王の子を",
      "translatedEnglishLine": "\"But that said, I can't just kill the Dark Lord's children on my own accord."
    },
    {
      "lineNumber": 197844,
      "originalJapaneseLine": "　独断で殺すわけにもいかねぇ」",
      "translatedEnglishLine": ""
    },
    {
      "lineNumber": 197845,
      "originalJapaneseLine": "「魔人は魔王に絶対服従。",
      "translatedEnglishLine": "\"Demons must obey the Dark Lord absolutely."
    },
    {
      "lineNumber": 197846,
      "originalJapaneseLine": "　ご機嫌を損ねて、死ねとでも命令されちゃコトだ」",
      "translatedEnglishLine": "If they displease him, I'll be ordered to die."
    },
    {
      "lineNumber": 197847,
      "originalJapaneseLine": "「思い切りやり合うのも面白そうだが……",
      "translatedEnglishLine": "It might be fun to fight to the fullest..."
    },
    {
      "lineNumber": 197848,
      "originalJapaneseLine": "　俺としては諦めて帰ってくれるのを",
      "translatedEnglishLine": "But for me, I hope they just give up and go home."
    },
    {
      "lineNumber": 197849,
      "originalJapaneseLine": "　期待しているんだがね」",
      "translatedEnglishLine": "\""
    },
    {
      "lineNumber": 197850,
      "originalJapaneseLine": "「な、舐めた真似をぉ〜……！」",
      "translatedEnglishLine": "\"D-don't you dare underestimate me~...!\""
    },
    {
      "lineNumber": 197851,
      "originalJapaneseLine": "「はあ、はあ……",
      "translatedEnglishLine": "\"Hah, hah..."
    },
    {
      "lineNumber": 197852,
      "originalJapaneseLine": "　なんで、この人……こんな強いの……」",
      "translatedEnglishLine": " Why is this person... so strong...?\""
    },
    {
      "lineNumber": 197853,
      "originalJapaneseLine": "（俺が強ぇんじゃなくて、",
      "translatedEnglishLine": "(It's not that I'm strong,"
    },
    {
      "lineNumber": 197854,
      "originalJapaneseLine": "　嬢ちゃん達が疲れすぎなだけだと思うがね……）",
      "translatedEnglishLine": " I think the girls are just way too tired...)"
    },
    {
      "lineNumber": 197855,
      "originalJapaneseLine": "（ま、わざわざ言わねぇでおくが）",
      "translatedEnglishLine": "(Well, I won’t say that outright.)"
    },
    {
      "lineNumber": 197856,
      "originalJapaneseLine": "「ど、どうしよう……どうしよう……",
      "translatedEnglishLine": "\"W-what should I do... what should I do..."
    },
    {
      "lineNumber": 197857,
      "originalJapaneseLine": "　このままじゃ……う、お姉ちゃんが……」",
      "translatedEnglishLine": " If this goes on... u-older sister is going to...\""
    },
    {
      "lineNumber": 197858,
      "originalJapaneseLine": "「う〜〜〜〜……」",
      "translatedEnglishLine": "\"Uuuuuuu...\""
    },
    {
      "lineNumber": 197859,
      "originalJapaneseLine": "「……さて、どうする、かな」",
      "translatedEnglishLine": "\"...Well then, what to do, I wonder.\""
    },
    {
      "lineNumber": 197860,
      "originalJapaneseLine": "「チイッ！」",
      "translatedEnglishLine": "\"Tch!\""
    },
    {
      "lineNumber": 197861,
      "originalJapaneseLine": "「仕方ない、か……」",
      "translatedEnglishLine": "\"I guess it can't be helped...\""
    }
  ]
}

